import React from 'react'

const Person = ({ person }) => {
    return (
        <p> {person.name} {person.number}  <Button value = 'delete'/>

        </p>
    )
}

const Button = () => {

    return (
        <button value = 'delete' />
    )
}


const ListPeople = (props) => {
    return (
        <div>
            {props.namesToShow.map((name) =>
                <Person key={name.name} person={name} />

            )}

        </div>
    )
}

export default ListPeople
